create extension if not exists "uuid-ossp";

drop table if exists provider_iox, product_hrf, provider_product_info_ybs, car_crh, provider_car_info_2jd cascade;

create table provider_iox
(
    id      uuid primary key,
    name    text,
    phone   text
);

create table product_hrf
(
    id              uuid primary key,
    model           text,
    category        text,
    brand           text,
    score           numeric,
    screen_material text,
    screen_size     int,
    height          int,
    width           int,
    weight          int,
    sales_start     int,
    sales_end       int,
    os              text,
    color           text
);

create table provider_product_info_ybs
(
    provider_id uuid references provider_iox,
    product_id uuid references product_hrf,
    price numeric,
    quantity int,
    primary key (product_id, provider_id)
);

create table car_crh
(
    id                uuid primary key,
    model             text,
    body_volume       int,
    lifting_capacity  int
);

create table provider_car_info_2jd
(
    provider_id uuid references provider_iox,
    car_id uuid references car_crh,
    quantity int,
    primary key (car_id, provider_id)
);





